    {% endif %}

    {%- if var('snowplow__page_view_passthroughs', []) -%}
      {%- set passthrough_names = [] -%}
      {%- for identifier in var('snowplow__page_view_passthroughs', []) %}
      {# Check if it is a simple column or a sql+alias #}
        {%- if identifier is mapping -%}
